import './App.css';

function App() {
  return (
    <div className="App">
    <header>
      <h1><em>Curriculum </em></h1>            
    </header>
      <p>
      This is how we plan to teach during our Bootcamp. We will deviate as deemed fit by the instructor whenever required.There will be several micro and mega projects we will be building along the way.
      </p>
      <h2>Useful Links</h2>
      <ul>
        <li style="display:none">Set up Call with Instructor : Here or email sachin@wynisco.com</li>
        <li>Apply for program : Here</li>
        <li>Website : Here</li>
      </ul>
    </div>
  );
}

export default App;
